const Foo = () => {
    const history = useHistory();
  
    return (
      <div>
        <button onClick={history.goBack}>Back</button>
        <p>foo</p>
      </div>
    );
  };
  
  const Bar = () => {
    const history = useHistory();
  
    return (
      <div>
        <button onClick={history.goBack}>Back</button>
        <p>bar</p>
      </div>
    );
  };
  
  export default function App() {
    return (
      <Router>
        <div>
          <ul>
            <li>
              <Link to="/foo">foo</Link>
            </li>
            <li>
              <Link to="/bar">bar</Link>
            </li>
          </ul>
  
          <Switch>
            <Route path="/foo" children={<Foo />} />
            <Route path="/bar" children={<Bar />} />
          </Switch>
        </div>
      </Router>
    );
  }
